import {memo, useSelector, Avatar_Give_Me_List,GameCreateAvatar ,GameSelectAvatar, useStore, useState, useEffectV2, Container, Settings} from "./../../importAll";
import MusicEffect from "./comps/MusicEffect";


const Game = memo(()=>{
    let mainPage                    = useSelector<IStore,AllMainPagesType>(store=>store.mainPage)
    let settings                    = useSelector<IStore,Settings>(store=>store.settings)
    let store                       = useStore();
    
    
    useEffectV2("Game",()=>Avatar_Give_Me_List(store)) 
    
    if(mainPage != "Game") return <></>;
    
    return( 
         <Container grid={settings.CONTAINER_APP_GRID} width="110vh" height="90vh" margin="10px auto" border> 
            <GameSelectAvatar/>
            <GameCreateAvatar/>
            <MusicEffect/>
        </Container>
    )
});

export default Game;
